import React, { Component } from "react";

class buttons extends Component {
  state = {};

  render() {
    return (
      <div>
        <label>
          Category:
          <input
            type="text"
            onChange={() => this.props.onIncrement(this.props.counter)}
          />
        </label>
        <button
          type="submit"
          className="btn btn-primary"
          onClick={this.props.handleSubmit}
        >
          Primary
        </button>
      </div>
    );
  }
}

export default buttons;
